import React from 'react'
import { View, Text,StyleSheet } from 'react-native'



const TaskItem = () => {
    return (
        <View style={style.itemContainer}>
            <Text>Title</Text>
            <Text>Description</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    itemContainer:{
        backgroundColor:'#33333',
        padding:20
    }
})

export default TaskItem
